  //   ** x >= 0 **
  //
  // In contrast to other APIs the entries in b may be negative.
  //
  // Inputs:
  //   c  #x list of linear coefficients
  //   A  #A by #x matrix of linear constraint coefficients
  //   b  #A list of linear constraint right-hand sides
